import React from 'react';

const DurationItem = (props) => {
    return (
        <div className="task">
            <div className="task__content">
                <div>
                    Дата : {props.duration.workDate}
                    <br/>
                    <br/>
                    Время работы: {props.duration.timeCount}
                </div>
            </div>
        </div>
    );
};

export default DurationItem;
